     315致为一封信

     因为你的自强不息的精神，我爱上你了。因为你宣传爱国而笼罩上了民族品牌的光环，因为你号称技术先进、质量过硬，所以我淘汰了

      苹果手机

     而选择你的P10，但不幸的是，没到半年，你的一流产品便出现不能聚焦，照片模糊。通过网上查询得知，原来这种现象不并罕见，在网友的支招下，我每次照相之前都要拍打几下手机，或者用力的摇甩……手机机身和屏幕在我的爱护下至今光鲜照人，但是我却很无奈，淘汰还是继续忍受折磨？请你告诉我。

:下周手机微信网上选房，售楼处墙裂建议我用

      苹果手机

     抢，能用7别用6，能用8别用7，最好别用安卓机，我说我用小米6，他们劝我赶紧换，免得抢不到房子后悔。

     我该怎么办？？

